    <h1>My Fitness</h1>

    <div className="search">
      <input 
      placeholder="Search"
      value="Cardio"
      onChange={() => {}}
      />
      <img src={SearchIcon}
      alt="search"
      onClick={()=>{}}
      />
    </div>
    <div className="container">
      <div className="movie">
        <p>Hello</p>
      </div>
      <img src={'https://via.placeholder.com/400'} alt="400Image"/>
    </div>
    </div>
  );
}

export default App;
